// Import Firebase SDK functions
import { initializeApp } from 'firebase/app';
import { getAnalytics } from "firebase/analytics";
import { getAuth, GoogleAuthProvider, signInWithPopup, signOut } from 'firebase/auth';

// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional

const firebaseConfig = {
  apiKey: "AIzaSyCrZUfv7s27oDMBjmdq4UPPMurj-jYgA80",
  authDomain: "ascorp-69412.firebaseapp.com",
  projectId: "ascorp-69412",
  storageBucket: "ascorp-69412.firebasestorage.app",
  messagingSenderId: "474658604657",
  appId: "1:474658604657:web:e37caa2a0b18d6819a3dd0",
  measurementId: "G-48RGJ4JNCD"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);
const auth = getAuth(app);
